static gint about_tag;
static GdkFont *font1, *font2, *font3, *font4;
static GdkColormap *colormap;
static GdkPixmap *pixmap;
static GdkPixmap *bg_img;
static gint Yloc = 320;

GtkWidget*
about_background_add                    (gchar          *widget_name,
                                         gchar          *string1,
                                         gchar          *string2,
                                         gint            int1,
                                         gint            int2);
static void about_realize(GtkWidget *widget, gpointer data);
static void about_ok(GtkWidget *widget, gpointer data);
static gint about_update(gpointer data);
static gint about_draw_text(GtkDrawingArea *background, gchar *text, GdkFont *font, gint loc, gint start);


void about_create_or_raise(void)
{
	if (!about_dialog) {
		Yloc=320;
		about_dialog = create_dlg_about();
		gtk_widget_show(about_dialog);
	}
	else {
		gdk_window_show(about_dialog->window);
		gdk_window_raise(about_dialog->window);
	}
}

static void about_ok(GtkWidget *widget, gpointer data)
{
	gtk_timeout_remove(about_tag);
	gtk_widget_destroy(about_dialog);
	about_dialog = NULL;
	about_tag = 0;
}






GtkWidget*
create_dlg_about (void)
{
  GtkWidget *dlg_about;
  GtkWidget *dialog_vbox1;
  GtkWidget *background;
  GtkWidget *dialog_action_area1;
  GtkWidget *button_box;
  GtkWidget *ok_button;

  dlg_about = gtk_dialog_new ();
  gtk_object_set_data (GTK_OBJECT (dlg_about), "dlg_about", dlg_about);
  gtk_window_set_title (GTK_WINDOW (dlg_about), _("About"));
  GTK_WINDOW (dlg_about)->type = GTK_WINDOW_DIALOG;
  gtk_window_set_policy (GTK_WINDOW (dlg_about), FALSE, FALSE, FALSE);

  dialog_vbox1 = GTK_DIALOG (dlg_about)->vbox;
  gtk_object_set_data (GTK_OBJECT (dlg_about), "dialog_vbox1", dialog_vbox1);
  gtk_widget_show (dialog_vbox1);

  background = about_background_add ("background", NULL, NULL, 0, 0);
  gtk_widget_ref (background);
  gtk_object_set_data_full (GTK_OBJECT (dlg_about), "background", background,
                            (GtkDestroyNotify) gtk_widget_unref);
  gtk_widget_show (background);
  gtk_box_pack_start (GTK_BOX (dialog_vbox1), background, FALSE, FALSE, 0);
  gtk_widget_set_usize (background, 250, 300);
  GTK_WIDGET_UNSET_FLAGS (background, GTK_CAN_FOCUS);
  GTK_WIDGET_UNSET_FLAGS (background, GTK_CAN_DEFAULT);

  dialog_action_area1 = GTK_DIALOG (dlg_about)->action_area;
  gtk_object_set_data (GTK_OBJECT (dlg_about), "dialog_action_area1", dialog_action_area1);
  gtk_widget_show (dialog_action_area1);
  gtk_container_set_border_width (GTK_CONTAINER (dialog_action_area1), 10);

  button_box = gtk_hbutton_box_new ();
  gtk_widget_ref (button_box);
  gtk_object_set_data_full (GTK_OBJECT (dlg_about), "button_box", button_box,
                            (GtkDestroyNotify) gtk_widget_unref);
  gtk_widget_show (button_box);
  gtk_box_pack_start (GTK_BOX (dialog_action_area1), button_box, TRUE, TRUE, 0);

  ok_button = gtk_button_new_with_label (_("OK"));
  gtk_widget_ref (ok_button);
  gtk_object_set_data_full (GTK_OBJECT (dlg_about), "ok_button", ok_button,
                            (GtkDestroyNotify) gtk_widget_unref);
  gtk_widget_show (ok_button);
  gtk_container_add (GTK_CONTAINER (button_box), ok_button);
  GTK_WIDGET_SET_FLAGS (ok_button, GTK_CAN_DEFAULT);

  gtk_signal_connect (GTK_OBJECT (dlg_about), "destroy",
                      GTK_SIGNAL_FUNC (about_ok),
                      NULL);
  gtk_signal_connect (GTK_OBJECT (dlg_about), "realize",
                      GTK_SIGNAL_FUNC (about_realize),
                      NULL);
  gtk_signal_connect (GTK_OBJECT (dlg_about), "expose_event",
                      GTK_SIGNAL_FUNC (about_update),
                      NULL);
  gtk_signal_connect (GTK_OBJECT (ok_button), "clicked",
                      GTK_SIGNAL_FUNC (about_ok),
                      NULL);

  return dlg_about;
}


